int main() {
    // Create a new GEMs object
    gem::SharedPointer<gem::Object> obj = gem::SharedPointer<gem::Object>(new gem::Object());

    // Use the object
    obj->doSomething();

    // The object will be automatically deleted when the shared pointer goes out of scope
    return 0;
}
```

